    false,nt"url": null,nt"notes": "EX1202 Leg I of NOAA Ship Okeanos Explorer
    (EX) is focused on exploration of North Eastern region of Gulf of Mexico using the
    shipsu00c3u00a2u00c2u0080u00c2u0099 Kongsberg EM302 multibeam sonar, EK 60 and Knudsen
    sub-bottom profiler. EX1202 Leg I operations are expected to commence on February
    27, 2012 at Charleston, SC and conclude on March 14, 2012 at Tampa, FL. The planed
    transit line from Charleston, SC to the working grounds is ~ 1000 nautical miles
    and is expected to take ~ 5 days at an average speed of 8.5 knots.  Multibeam mapping
    operations will be conducted 24 hours a day during the transit, including regular
    XBT casts.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
